import Navbar from './components/Navbar';
import React from "react";
import './App.css';
import { BrowserRouter as Link } from 'react-router-dom';

function App() {
  return (
    <div className="Page">
    <div className="App">

        <h1>
          <Link to="/">
          </Link>
          Race Organization</h1>

      <Navbar />
    </div>
    </div>
  );
}

export default App;
